import React from 'react';
import ImgMediaCard1 from '../components/ArtDesign/card';
import { motion } from 'framer-motion';
import fakeData from '../fakeData/operators.json';
import { NavLink } from 'react-router-dom';

const Main = () => {
  const operatorsItem = fakeData.map((operator) => (
    <ImgMediaCard1
      alt={operator.alt}
      image={operator.url}
      title={operator.title}
      id={operator.id}
    />
  ));
  return (
    <div>
      <motion.div
        className="title"
        initial={{ y: -250 }}
        animate={{ y: -30 }}
        transition={{ delay: 0.2, type: 'spring' }}>
        <h1 className="h1Main">Выберите оператора</h1>
      </motion.div>
      <div className="contentMain">
        <div>{operatorsItem}</div>
        {}
      </div>
    </div>
  );
};

export default Main;
